import React from "react";
import styled from "styled-components";

// IMPORT COMPONENTS
import MenuItems from "./MenuItems";

function Nav() {
  return (
    <React.Fragment>
      <NavContainer>
        <LogoContainer>
          <h1>React Meals</h1>
        </LogoContainer>
        <MenuItems />
      </NavContainer>
    </React.Fragment>
  );
}

export default Nav;

const NavContainer = styled.div`
  display: flex;
  align-items: center;
  width: 100%;
  height: 10vh;
`;

const LogoContainer = styled.div`
  color: white;
  width: 40%;
  text-align: center;
`;
